import React from 'react';
import {GridList,GridListTile,ListSubheader,GridListTileBar} from '@material-ui/core'

function Body(props) {
  return (
  <div>
      <div >
      <GridList cellHeight={180} >
        {props.data.map(val => (
          <GridListTile key={val.id}>
            <img src={`https://farm${val.farm}.staticflickr.com/${val.server}/${val.id}_${val.secret}.jpg`} />
          </GridListTile>
        ))}
      </GridList>
    </div>
{/*       
      {
    props.data.map((val) => <img key={val.id} src={`https://farm${val.farm}.staticflickr.com/${val.server}/${val.id}_${val.secret}.jpg`}/>)
  } */}
  </div>
  );
}

export default Body;
